#define CHECK_GRADIENT(grad, ref_grad)                                       \
    for (unsigned i1 = 0; i1 < grad.shape()[0]; ++i1)                        \
        for (unsigned i2 = 0; i2 < grad.shape()[1]; ++i2)                    \
            for (unsigned i3 = 0; i3 < grad.shape()[2]; ++i3)                \
                for (unsigned i4 = 0; i4 < grad.shape()[3]; ++i4)            \
                    for (unsigned i5 = 0; i5 < grad.shape()[4]; ++i5)        \
                        BOOST_CHECK_CLOSE(grad[i1][i2][i3][i4][i5],          \
                                          ref_grad[i1][i2][i3][i4][i5],      \
                                          1e-5)

#define GENERATE_TEST_CASE(k, l, m, n, a, d)                                 \
    const boost::array<unsigned, 5> extents = {                              \
        {3, 2 * k + 1, 2 * l + 1, 2 * m + 1, 2 * n + 1}                      \
    };                                                                       \
    boost::multi_array<double, 5> grad(extents);                             \
    std::fill_n(grad.data(), grad.num_elements(), 0);                        \
    eri_gradient(k, l, m, n, a,                                              \
                 ae, xA, yA, zA,                                             \
                 be, xB, yB, zB,                                             \
                 ce, xC, yC, zC,                                             \
                 de, xD, yD, zD,                                             \
                 bs,                                                         \
                 grad[0].origin(),                                           \
                 grad[1].origin(),                                           \
                 grad[2].origin());                                          \
    boost::const_multi_array_ref<double, 5> ref_grad(d, extents);            \
    CHECK_GRADIENT(grad, ref_grad);

